import React, { Fragment } from 'react';
import { Link } from 'react-router-dom';

const NavBar = ({ token, setToken }) => {

    const dropToken = () => {
        setToken(null)
    }

    return (
        <nav className="navbar">
            <h1>Secret Werewolf</h1>
            <div className="links">
                <Link to='/'>Home </Link>
                <Link to='/listaccounts'>Leaderboard </Link>
                <Link to='/accountdetails'>My Account </Link>

                { !token? <> <Link to='/signin'>Sign In </Link> <Link to='/signup'>Sign up </Link> </> : 
                             <button onClick={dropToken}> Sign out </button> }
            </div>
        </nav>
    );
}

export default NavBar;
